import PropTypes from 'prop-types';

function Header({ text }) {
  const headerStyles = {
    backgroundColor: '#333',
    color: 'black',
  };

  return (
    <header style={headerStyles}>
      <div className="container">
        <h2>{text}</h2>
      </div>
    </header>
  );
}

Header.defaultProps = {
  text: 'Default text',
  bgColor: 'rgba(0, 0, 0, 0.5)',
  color: 'white',
};

Header.propTypes = {
  text: PropTypes.string,
};

export default Header;
